import Nav from "react-bootstrap/Nav";
import Tab from "react-bootstrap/Tab";
import { MobileNav } from "./MobileNav";
import { BiSearchAlt } from "react-icons/bi";

const NavLink = (props) => {
  return (
    <>
      <Nav.Link eventKey="first">
        <ChatLitUi
          userName={props.userName}
          userImg={props.userImg}
          UserStatus={props.UserStatus}
          userLastTime={props.userLastTime}
          userTotleMessage={props.userTotleMessage}
        />
      </Nav.Link>
    </>
  );
};
const TabPane = () => {
  return (
    <>
      <Tab.Pane eventKey="first">
        <MessigeChatUi />
      </Tab.Pane>
      <Tab.Pane eventKey="first2">
        <MessigeChatUi />
      </Tab.Pane>
    </>
  );
};

export const Chat = (props) => {
  //   const ChatData = [
  //     {
  //       userName: "silver",
  //       cat1: [
  //         {
  //           points: "Id dolor sagittis, neque",
  //         },
  //       ],
  //     },
  //   ];
  //   {props.arr.cat1.map((val, i) => {
  //                   return (

  //                   );
  //   })
  //     }
  //      {ChatData.map((val, i) => {
  //               return <ChatApp key={i} {...val} arr={val} />;
  //             })}
  return (
    <>
      <div className="chat_div">
        <Tab.Container id="left-tabs-example" defaultActiveKey="first">
          <div className="row">
            <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-12 col-sm-12 col-12">
              <div className=" d-none d-xxl-block d-xl-block d-lg-block ">
                <ChatUser
                  userName={props.userName}
                  userImg={props.userImg}
                  UserStatus={props.UserStatus}
                  userLastTime={props.userLastTime}
                  userTotleMessage={props.userTotleMessage}
                />
              </div>
              <div className=" d-block d-xxl-none d-xl-none d-lg-none">
                <MobileNav
                  data={
                    <ChatUser
                      userName={props.userName}
                      userImg={props.userImg}
                      UserStatus={props.UserStatus}
                      userLastTime={props.userLastTime}
                      userTotleMessage={props.userTotleMessage}
                    />
                  }
                />
              </div>
            </div>
            <div className="col-xxl-9 col-xl-9 col-lg-9 col-md-12 col-sm-12 col-12">
              <Tab.Content>
                <TabPane />
              </Tab.Content>
            </div>
          </div>
        </Tab.Container>
      </div>
    </>
  );
};
const ChatUser = (props) => {
  return (
    <>
      <Nav variant="pills" className="flex-column">
        <div className="chat_search_div">
          <span>
            <BiSearchAlt />
          </span>
          <input type="text" placeholder="search" />
        </div>
        <div className="chat_list_top_div">
          <Nav.Item>
            <NavLink
              userName={props.userName}
              userImg={props.userImg}
              UserStatus={props.UserStatus}
              userLastTime={props.userLastTime}
              userTotleMessage={props.userTotleMessage}
            />
          </Nav.Item>
        </div>
      </Nav>
    </>
  );
};

const ChatLitUi = (props) => {
  return (
    <>
      <div className="chat_list_div">
        <ul>
          <li>
            {/* <div
              className="chat_list_img"
              style={{
                backgroundImage: `url("https://source.unsplash.com/random/500x500/?face")`,
              }}
            ></div> */}
            <div
              className="chat_list_img"
              style={{
                backgroundImage: `url(${props.userImg})`,
              }}
            ></div>
          </li>
          <li className="chat_list_name_div">
            <p>{props.userName}</p>
            <div className="chat_status_div">
              <h3>{props.UserStatus}</h3>
              <div className="stage">
                <div className="dot-flashing"></div>
              </div>
            </div>
          </li>
          <li className="chat_list_time">
            <p>{props.userLastTime}</p>
            <div className="chat_list_mess_number">
              {props.userTotleMessage}
            </div>
          </li>
        </ul>
      </div>
    </>
  );
};

const MessigeChatUi = () => {
  return (
    <>
      <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3 ">
        <div className="col-12">
          <div className="chat_label_div">
            <div>Bella Cote</div>
          </div>
        </div>
        <div className="col-12">
          <div className="chat_mes_main_div">fjnvjgf</div>
        </div>
      </div>
    </>
  );
};
